import React, { useEffect, useState } from "react";
import { parseUser, User } from "./utils/DataStructures";

function Account({ tokenObj }) {
  const [profile, setProfile] = useState();
  useEffect(() => {
    const formData = new FormData();
    formData.append("email", tokenObj.email);
    fetch("/user", {
      method: "PUT",
      body: formData,
    })
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        setProfile(parseUser(data));
        console.log(profile);
      })
      .catch((error) => {
        console.log(error);
      });
  },[]);
  return (
    <div>
      <h2>Edit Account</h2>
      <p>All encompassing app for students at UC Davis to meet and connect.</p>
      <p>Sign In now with your UC Davis email to see what it is about!</p>
    </div>
  );
}
export default Account;
